<template>
  <view class="demo-signature">
    <demo-item :title="signature_1.title">
      <xz-signature v-model="signature_1.val" tip="签名完毕请点击保存" />
      <image :src="signature_1.val" class="demo-signature__preview" />
    </demo-item>
    <demo-item :title="signature_2.title">
      <xz-signature v-model="signature_2.val" landscape />
      <image :src="signature_2.val" class="demo-signature__preview" />
    </demo-item>
    <demo-item :title="signature_3.title">
      <xz-signature v-model="signature_3.val"
                    landscape bgc="#F0F0F0"
                    placeholder="请确保本人签名" placeholder-landscape="签名是代表本人的重要凭证之一"
                    tip="点击保存退出签名" tip-color="#600000" confirm-text="确定" cancel-text="取消" />
      <image :src="signature_3.val" class="demo-signature__preview" />
    </demo-item>
    <demo-item :title="signature_4.title" :sub-title="signature_4.subtitle">
      <xz-signature :ref="el => $ref.signature_4 = el"
                    landscape v-model="signature_4.val" />
      <image :src="signature_4.val" class="demo-signature__preview" />
    </demo-item>

    <!--    <view class="cover">-->
    <!--      覆盖测试-->
    <!--    </view>-->
  </view>
</template>

<script lang="ts" setup>
  /*
   * 组件名: index
   * 组件用途: 签名组件示例
   * 创建日期: 2023/7/16
   * 编写者: XianZhe
   */
  import {
    computed, reactive, onMounted,
    onUnmounted,
    type ComponentPublicInstance
  } from "vue";
  //  import Signature from "@/components/signature";

  const $ref: Record<string, ComponentPublicInstance<any>> = reactive({
    signature_4: null
  });
  const $state = reactive({});

  const signature_1 = reactive({
    title: "基本使用",
    // val: "data:image/gif;base64,"
    val: ""
  });

  const signature_2 = reactive({
    title: "横屏",
    val: ""
  });

  const signature_3 = reactive({
    title: "自定义颜色与提示",
    val: ""
  });

  const signature_4 = reactive({
    title: "手动保存",
    subtitle: "",
    val: "",
    timer: null as null | number
  });

  function signature_4AutoSave() {
    let count = 10;
    signature_4.timer = setInterval(() => {
      signature_4.subtitle = `将在${count}秒后自动保存`;
      if (count === 0) {
        count = 10;
        console.log("在调用吗？");
        $ref.signature_4?.saveEvent();
        return;
      }
      count--;
    }, 1000);
  }

  onMounted(() => {
    signature_4AutoSave();
  });

  onUnmounted(() => {
    clearInterval(signature_4.timer as number)
  })
</script>

